SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET escape_string_warning = off;
SET default_tablespace = '';
SET default_with_oids = false;


DROP SCHEMA IF EXISTS iris CASCADE;

CREATE SCHEMA iris AUTHORIZATION postgres;

COMMENT ON SCHEMA iris IS 'Iris webservice database';

SET search_path = iris, public, pg_catalog;


--                                                                             --
-- Category table                                                              --
--                                                                             --

DROP TABLE IF EXISTS category CASCADE;

CREATE TABLE category (
 uid SMALLINT NOT NULL,
 name CHARACTER VARYING(31),
 note CHARACTER VARYING(255)
);

ALTER TABLE category OWNER TO postgres;

COMMENT ON TABLE category IS 'Categories of the unusable ICD-10 Code';

COMMENT ON COLUMN category.uid IS 'Identifier of the category';

COMMENT ON COLUMN category.name IS 'Name of the category';

COMMENT ON COLUMN category.note IS 'Note about the category';


ALTER TABLE ONLY category ADD CONSTRAINT category_pkey PRIMARY KEY (uid);

REVOKE ALL ON TABLE category FROM PUBLIC;

GRANT ALL ON TABLE category TO postgres;


--                                                                             --
-- Level table                                                                 --
--                                                                             --

DROP TABLE IF EXISTS level CASCADE;

CREATE TABLE level (
 uid SMALLINT NOT NULL,
 name CHARACTER VARYING(31),
 note CHARACTER VARYING(255)
);

ALTER TABLE level OWNER TO postgres;

COMMENT ON TABLE level IS 'Levels of the garbage code';

COMMENT ON COLUMN level.uid IS 'Identifier of the level';

COMMENT ON COLUMN level.name IS 'Name of the level';

COMMENT ON COLUMN level.note IS 'Note about the level';


ALTER TABLE ONLY level ADD CONSTRAINT level_pkey PRIMARY KEY (uid);

REVOKE ALL ON TABLE level FROM PUBLIC;

GRANT ALL ON TABLE level TO postgres;


--                                                                             --
-- icd10code table                                                            --
--                                                                             --

DROP TABLE IF EXISTS icd10code CASCADE;

CREATE TABLE icd10code (
  code CHARACTER VARYING(4) NOT NULL,
  name CHARACTER VARYING(255) NOT NULL,
  garbage SMALLINT NOT NULL,
  category SMALLINT NOT NULL,
  level SMALLINT NOT NULL,
  note CHARACTER VARYING(511)
);

ALTER TABLE icd10code OWNER TO postgres;

COMMENT ON TABLE icd10code IS 'ICD-10 Codes';

COMMENT ON COLUMN icd10code.code IS 'ICD-10 Code';

COMMENT ON COLUMN icd10code.name IS 'Name of the ICD-10 Code';

COMMENT ON COLUMN icd10code.garbage IS 'ICD-10 Code is a garbage code';

COMMENT ON COLUMN icd10code.category IS 'Category of the unusable ICD-10 Code';

COMMENT ON COLUMN icd10code.level IS 'Level of the garbage code';

COMMENT ON COLUMN icd10code.note IS 'Note about the ICD-10 Code';


ALTER TABLE ONLY icd10code ADD CONSTRAINT icd10code_pkey PRIMARY KEY (code);

REVOKE ALL ON TABLE icd10code FROM PUBLIC;

GRANT ALL ON TABLE icd10code TO postgres;
